  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:51.263410\",\n\t\"name\": \"roanoke-river-national-wildlife-refuge-annual-narrative-calendar-year-2006-e56e4\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative for Roanoke River
  National Wildlife Refuge outlines Refuge accomplishments during the 2006 calendar
  year. The report begins with a forward, introduction, and a climatological review.
  The report discusses monitoring and studies, including surveys and censuses, and
  studies and investigations. The habitat restoration section of the report includes
  wetland restoration. Habitat management is also covered; subjects include management
  of water levels and soil units, and the control of pest plants. The fish and wildlife
  section of the report discusses bird banding and nest structure provision. Coordination
  activities are included, such as interagency coordination, intra-agency coordination,
  private land activities, and cooperative/friends organizations. The resource protection
  section of the report discusses law enforcement, wildlife preparedness, management
  of permits and economic uses, and contaminant investigation and cleanup. Public
  education and recreation is outlined; information on visitor services and outreach
  is given. The planning and administration section of the report discusses general
  administration, and personnel.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
